ACCESS_DENIED__REUSE_ATTACHMENT=&ldquo;{1}&rdquo; இந்த இணைப்பினை மீண்டும் பயன்படுத்த அனுமதி இல்லை.
ACCESS_DENIED__CATEGORY_ACCESS=&ldquo;{1}&rdquo; இந்த வகையினை மீண்டும் பயன்படுத்த அனுமதி இல்லை.
ACCESS_DENIED__CATEGORY_ACCESS_LEVEL=&ldquo;{1}&rdquo; இந்த வகையில் போதிய அளவிற்கு அதிகாரம் இல்லை.
ACCESS_DENIED__PAGE_ACCESS=&ldquo;{1}&rdquo; இந்த பக்கத்திற்கு அனுமதி இல்லை.
ACCESS_DENIED__CATALOGUE_ACCESS=&ldquo;{1}&rdquo; இந்த அட்டவணைக்கு அனுமதி இல்லை.
ACCESS_DENIED__ZONE_ACCESS=&ldquo;{1}&rdquo;-ற்கு <kbd>{2}</kbd> மண்டலத்திற்கு செல்ல அனுமதி இல்லை</kbd>.
ACCESS_DENIED__SESSION=உங்கள் &ldquo;{1}&rdquo; உள்நுழைவு உயர் பாதுகாப்பு பகுதியில் நுழைய முன் மீண்டும் உறுதி செய்யப்பட வேண்டும் (நீங்கள் தற்போது ஒரு உறுதி செய்யப்பட்ட அமர்வில் இல்லை)
ACCESS_DENIED__ACCESS_DENIED=&ldquo;{1}&rdquo;-க்கு அனுமதி மறுக்கப்பட்டுள்ளது (மேற்கொண்டு எந்த விபரங்களும் குறிப்பிடவில்லை).
ACCESS_DENIED__NOT_AS_GUEST=நீங்கள் இந்த செயலை செய்ய உள்நுழைந்ததிருக்க வேண்டும்.
ACCESS_DENIED__NOT_AS_GUEST_CALENDAR_PERFORMANCE=சில நிகழ்வுகள் காலவரையின்றி கட்டமைக்கப்பட்ட கூடும் என்றாலும், இந்த கால நிலை கட்டமைக்கப்பட்ட காலண்டர் நிகழ்வுகள் அளவுகளைத் தாண்டி உள்ளது. செயல்திறன் காரணங்களுக்காக விருந்தினர்களின் எல்லை தாண்டி உள்ள கால நிகழ்வுகள் தடுக்கப்படும்.

ACCESS_DENIED__ZONE_ACCESS_SESSION=உங்கள் &ldquo;{1}&rdquo; உள்நுழைவு உயர் பாதுகாப்பு பகுதியில் நுழைய முன் மீண்டும் உறுதி செய்யப்பட வேண்டும் (நீங்கள் தற்போது ஒரு உறுதி செய்யப்பட்ட அமர்வில் இல்லை)
USE_DEFAULT=இயல்புநிலை
